import './Navbar.css'
import {Link,Route,Routes} from 'react-router-dom'
import About from '../About/About'
import Contact from '../Contact/Contact'
// import Home from '../Home/Home'
import Employee from '../Employee/Employee'
import  Crud from '../Crud/Crud'
import $ from 'jquery';
function Navbar(){
 let isLog = true;
    return(
        <>
        <div class="navbar">
            
                <nav>
                <img src="https://media.istockphoto.com/id/1193845414/vector/overlapping-one-line-letter-t-logotype.jpg?s=612x612&w=0&k=20&c=l8rRi4CJzTPOFvIek_ANCTZuiAGvo69zBEzhbhMJFlg=" width="55" height="55"></img>

                <ul>
                    
            <li><Link  class="name" to="/"><i class="fa-solid fa-house"></i> Home</Link></li>

        <li><Link class="name" to="Contact"><i class="fa-solid fa-phone"></i> Contact</Link></li>
        <li><Link class="name" to="About"><i class="fa-regular fa-address-card"></i> About</Link></li>
        {/* {
                    isLog ? (<li><Link  class="name"to="Login"><i class="fa-solid fa-right-to-bracket"></i> Logout</Link></li>) : (<li><Link  class="name"to="Login"><i class="fa-solid fa-right-to-bracket"></i> Login</Link></li>)
                }
        <li><Link class="name" to="Hook">Hooks</Link></li> */}
        <li><Link class="name" to="Employee">Employee</Link></li>
        <li><Link class="name" to="Crud">Crud</Link></li>

        </ul> 
        
        </nav>
        </div>
        
        <Routes>
        <Route exact path='/About' element={<About />}></Route>
        <Route exact path='/Contact' element={<Contact />}></Route>
        {/* <Route exact path='/Login' element={<Login />}></Route>
        <Route exact path='/Hook' element={<Hook />}></Route> */}
        <Route exact path='/Employee' element={<Employee />}></Route>
        {/* <Route exact path='/' element={<Home/>}></Route> */}
        <Route exact path='/Crud' element={<Crud />}></Route>


    </Routes>
  
    </>
    )
}

var navstatus=0;
function openNav(){
    if(!navstatus){
    
        $('.maindiv').css('width','100%')
        $('li').css('display','block')
        navstatus=1

    }
    else{
        $('.maindiv').css('width','0')
        $('li').css('display','none')
        navstatus=0

    }
}
export default Navbar // we can keep the
